public static TermStyle get( String p )
{
  if( p != null ) {
    p = p.toUpperCase();
    if( p.equals( "DETAILS" ) ) {
      return DETAILS;
    }
    else if( p.equals( "LIST" ) ) {
      return LIST;
    }
  }
  return NONE; 
}

